drop table if exists [dbo].MOCK_PATIENT_RECORDS;

create table [dbo].MOCK_PATIENT_RECORDS (
	id int identity(1,1) primary key,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	date_of_birth DATE,
	gender VARCHAR(50),
	email VARCHAR(50),
	current_address VARCHAR(200),
	current_city VARCHAR(50),
	current_state VARCHAR(50),
	visit_date DATE,
	diagnosis_code VARCHAR(50),
	diagnosis_long VARCHAR(1000),
	diagnosis_short VARCHAR(200),
	perscribed_medication VARCHAR(1000),
	profession VARCHAR(200),
	pharmacy VARCHAR(200),
	phone_number VARCHAR(50),
	ssn VARCHAR(50)
);

